import React from 'react'
import AffichereFil from './AffichereFil'
export default function App() {
  let ListeM1=["Module11 "," Module12 "," Module13 "," Module14"];
  let ListeM2=["Module21","Module22","Module23","Module24"];
  let ListeM3=["Module31","Module32","Module33","Module34"];
  let Fillier=[
    {codefil:24,nomfil:"TDI"},
    {codefil:23,nomfil:'Resaux'},
    {codefil:55,nomfil:'commerece'}
      ]
  return (
    <div>
    
      <AffichereFil Fillier={Fillier[0]}>
      {
             ListeM1.map((elm,index)=>{
                return <idv key={index}>{elm}</idv>
              })
        }
        </AffichereFil >
      <AffichereFil Fillier={Fillier[1]} ListeM2={ListeM2}> 
      </AffichereFil >
    <AffichereFil Fillier={Fillier[2]} ListeM3={ListeM3}>
       </AffichereFil >
    </div>
  )
}
